import react from "react"
import ReactDom from 'react-dom'
import './style.css'
var cur = new Date()
let greet = ""
const cssstyle = {}
if (cur.getHours() >= 1 && cur.getHours() <= 11) {
  greet = "Morning"
  cssstyle.color = "green"
}
else if (cur.getHours() > 11 && cur.getHours() <= 19) {
  greet = "Evening"
  cssstyle.color = "red"
}
else {
  greet = "Night"
  cssstyle.color = "blue"
}
ReactDom.render(<><h1>Hello Sir <span style={cssstyle}>Good {greet}</span></h1></>, document.getElementById('root'))
